'use strict';

import Hapi from 'hapi';
import mongoose from 'mongoose';
const apollo = require('apollo-server-hapi');
const { graphqlHapi, graphiqlHapi } = apollo

import createStudentRoutes from './api/v1/student'
import schema from './graphql/schema';


// Create a server with a host and port
const server=Hapi.server({
    host:'localhost',
    port:8000
});

createStudentRoutes(server);

// Add the route
server.route({
    method:'GET',
    path:'/hello',
    handler:function(request,h) {

        return'hello world';
    }
});

// Start the server
const start =  async function() {

    try {
        //connect to mongo instance
        console.log('Conneting to database')
        mongoose.connect('mongodb://localhost:27017/soa4id', { useNewUrlParser: true });
        mongoose.connection.once('open',() => {
            console.log('Connected to database')
        })

        await server.register({
          plugin: graphiqlHapi,
          options: {
            path: '/graphiql',
            graphiqlOptions: {
              endpointURL: '/graphql'
            },
            route: { cors: true }
          }
        })

        await server.register({
          plugin: graphqlHapi,
          options: {
            path: '/graphql',
            graphqlOptions: { schema },
            route: { cors: true }
          }
        })

        console.log('Starting Server')
        await server.start();
    }
    catch (err) {
        console.log(err);
        process.exit(1);
    }

    console.log('Server running at:', server.info.uri);
};

start();

